import React from 'react';
import {    makeStyles } from '@material-ui/core/styles';
import SearchInput from '../component/SearchInput';
import DataTableHouse from '../component/DataTableHouse';
import axios from 'axios';
import {BASE_API} from '../constant/index';
import DataTypeRoom from '../component/DataTypeRoom';
import thunk from 'redux-thunk';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
    title:{
        paddingTop:'10px'

    },
    button:{
        margin:'10px',
    },
    button1:{
        width:'100%',
        textAlign:'right',
    }


}));

export default function TypeRoom() {
    const classes = useStyles();
    const [data, setData] = React.useState([])
  const [idType,setIdType] = React.useState()

   React.useEffect(()=>{
        axios.get(`${BASE_API}/type-rooms`)
        .then((reponse)=>{
            console.log(reponse.data)
            console.log('aaa')
            setData(reponse?.data)
        })
        .catch((error)=>{
            console.log(error)
        })
   },[])
   function getData(data){
    setIdType(data)
    }

    console.log(idType)

    return (
        <div className={classes.search}>
            <h2 className={classes.title}>Type Room</h2>
            <div className={classes.button1}>
                <Button className={classes.button} variant="contained" color="primary">Thêm</Button>
                <Button className={classes.button} variant="contained"
                disabled={idType ? 'false' : 'true'}
                >Sửa</Button>
                <Button className={classes.button} variant="contained" color="secondary"
                disabled={`${idType} ? 'false' : 'true'`}
                >Xóa</Button>
            </div>

            <DataTypeRoom data={data} sendData={getData}/>
        </div>
    );
}
